package string;

import java.util.Arrays;
import java.util.List;
import java.util.stream.Collectors;

public class SherlockAndValidString {

	public static void main(String args[]) {

		SherlockAndValidString testObj = new SherlockAndValidString();
		System.out.println(testObj.isValid(""));
	}

	public boolean isValid(String input) {

		int[] temp = new int[26];

		input = input.replaceAll(" ", "");
		System.out.println(input);
		
		for (int i = 0; i < input.length(); i++) {
			temp[input.charAt(i) - 'a']++;
		}

		System.out.println(Arrays.toString(temp));
		

		List<Integer> list = Arrays.stream(temp).boxed().filter(t -> t != 0).sorted().collect(Collectors.toList());

		System.out.println(list);

		if (list.get(0) == list.get(list.size() - 1)) {

			return true;
		}

		if (list.get(0) == 1 & (list.get(1) == list.get(list.size() - 1))) {

			return true;
		}

		if (list.get(0) == list.get(list.size() - 2) && (list.get(list.size() - 1) - list.get(list.size() - 2) == 1)) {

			return true;
		}

		return false;

	}

}
